import React,{ Component }from 'react';

class User extends Component{
  render() {
    <div>
      <h2>{this.props.id}</h2>
      <p>{this.props.pw}</p>
      <p>{this.props.name}</p>
      <p>{this.props.p1}</p>
      <p>{this.props.p2}</p>
      <p>{this.props.p3}</p>
      <p>{this.props.email}</p>
    </div>
  }
}

export default User;
